import React, { Component } from 'react'
import ReactDOM from 'react-dom';
import Loading from '../components/Loading';
import Ready from '../components/Ready';

const App = (props) => {
  return(
    <div>
      {(
        !context.isReady
        ?<Loading/>
        :<Ready/>
      )}
    </div>
  )
}

export default App;
